module ICFPC.Language.Combinators where

import ICFPC.Language
import ICFPC.Language.TH
import Language.Haskell.TH.Syntax


lambdaman1 :: Expr
lambdaman1 = $(lift . fromHaskell =<< [|
    "solve lambdaman1 UDLLLDURRRRRURR"
  |])

lambdaman2 :: Expr
lambdaman2 = $(lift . fromHaskell =<< [|
    "solve lambdaman2 RDURRDDRRUUDDLLLDLLDDRRRUR"
  |])

lambdaman3 :: Expr
lambdaman3 = $(lift . fromHaskell =<< [|
    "solve lambdaman3 DRDRLLLUDLLUURURLLURLUURRRRRDDDDULUULDUL"
  |])

lambdaman4 :: Expr
lambdaman4 = $(lift . fromHaskell =<< [|
    "solve lambdaman4 " <>
    let go = $(baseDecoderDouble "UDLR")
    in go go $(lift $ encodeBaseDouble "UDLR" "")
  |])

lambdaman5 :: Expr -- not optimal
lambdaman5 = $(lift . fromHaskell =<< [|
    "solve lambdaman5 " <>
    let go = $(baseDecoder "UDLR")
    in go go $(lift $ encodeBase "UDLR" "RDLLLULURRURRRRDRDRDLLDRLLDRLLLLLLLURLLURLLURULRURURURRRRRRRRRRDLLLRDRRDLRDDDLDRDLLLDRRRLLUUDLDLLLLLLLLLLLLURRRLULLURLUUUURURURURLLLLDRLDDDDDDRDRDRDRRRRRRRRRRUURURUUUUUUULLDLLLLLLLLDLDLDDDDRRDRRRRRRUUUULULLLL")
  |])

lambdaman6 :: Expr
lambdaman6 = $(lift . fromHaskell =<< [|
    "solve lambdaman6 " <> let
      triple x = x <> x <> x
    in triple $ triple $ triple "RRRRRRRR"
  |])

