lambdaman8 :: Expr
lambdaman8 = $(lift . fromHaskell =<< [|
    "solve lambdaman8 " <> let
      triple x = x <> x <> x
      times81 x = triple (triple (triple (triple x)))
    in times81 (times81 "DD" <> times81 "LL" <> times81 "UU" <> times81 "RR")
  |])

lambdaman9 :: Expr
lambdaman9 = $(lift . fromHaskell =<< [|
    "solve lambdaman9 " <> let
      quad x = x <> x <> x <> x
      times64 x = quad (quad (quad x))
    in times64 (times64 "R" <> "D" <> times64 "L")
  |])

lambdaman10 :: Expr
lambdaman10 = $(lift . fromHaskell =<< [|
    "solve lambdaman10 " <> let
      triple x = x <> x <> x
      times27 x = triple (triple (triple x))
      down = times27 (take 11 (times27 "D") <> "RDDL")
      up = times27 (times27 "U" <> "RUUL")
    in
      times27 (times27 (down <> up <> "R") <> down <> "R" <> up <> "R")
        <> times27 (times27 "D" <> "LDDR")
  |])

